import React, { useEffect, useState } from "react";

// Styles
import "./app.scss";
import "bootstrap/dist/css/bootstrap.css";


// Components
import { Nav } from "react-bootstrap";
import Header from "./components/Header";
import Footer from "./components/Footer";
import { Customer } from "./section/Customer";

function App() {
  return (
    <div className="app">
      {/* <Header /> */}
      <Nav variant="pills" defaultActiveKey="/home" className="navbar">
        <Nav.Item>
          <Nav.Link href="/admin/home"></Nav.Link>
        </Nav.Item>
        <Nav.Item>
          <Nav.Link href="/admin/orders">
            orders
          </Nav.Link>
        </Nav.Item>
        <Nav.Item>
          <Nav.Link href="/admin/customers">
            customers
          </Nav.Link>
        </Nav.Item>
        <Nav.Item>
          <Nav.Link href="/admin/suppliers">
            suppliers
          </Nav.Link>
        </Nav.Item>      
      </Nav>
      <Customer />
      <Footer />
    </div>
  );
}

export default App;
